import struct

data = bytes.fromhex('')
bytecode = struct.unpack('265Q', data)

flag_chars = []

for i in range(0, len(bytecode) - 1, 12):
    dividend = bytecode[i + 1]
    divisor = bytecode[i + 3]
    remainder = dividend % divisor
    flag_chars.append(chr(remainder))

flag = ''.join(flag_chars)
print(flag)